DEBUG - 2014-03-16 20:44:48 --> INSERT INTO `quku_songs_lrcs` (`sl_globalid`, `sl_song_id`, `sl_lrclink`, `sl_lyrics`, `sl_jointime`, `sl_usage_flag`) VALUES ('48307931', '48307945', 'http://bcs-sandbox.baidu.com/qukuauto/data2/lrc/48307931/48307931.lrc', '[ver:v1.0]\n[ti:4]\n\n[00:02.41]明明 - 蔡卓妍\n[00:27.23]我记得当日\n[00:29.69]与你最低温度下\n[00:32.38]吃博多拉面 你爱吃葱花\n[00:37.69]我记得当晚 四处借宿不会怕\n[00:42.99]旅舍租不了\n[00:45.64]两个也一家\n[00:48.24]但是当关系 渐渐活得不像话\n[00:53.69]浪漫似泡沫\n[00:56.24]慢慢地变化\n[00:58.94]结尾的一幕\n[01:01.64]你送我归家\n[01:03.54]红了眼睛地欢送最后落霞\n[01:07.39]明明不应该牵挂你神情\n[01:12.66]明明不应该将细节辨认\n[01:18.01]明明双方都打破约定\n[01:21.31]彼此都需要冷静\n[01:23.95]怎么始终我挥之不去窝心笑声\n[01:28.56]明明不应该一再说明明\n[01:34.06]明明好应该相信这是命\n[01:39.26]明明烛光都烧化散剩\n[01:42.66]讲分开都已决定\n[01:45.26]怎么一想你始终都会沾湿眼睛\n[01:49.96]人宁愿金鱼般记性\n[02:13.77]我记得生病 照顾我依偎附近\n[02:18.97]替我煲中药\n[02:21.57]昼晚也不分\n[02:24.27]我记得经过 有过教堂的市镇\n[02:29.62]你放轻声线\n[02:32.22]说过了婚姻\n[02:34.97]幸运的相遇 用尽大家的幸运\n[02:40.32]日落了以后\n[02:42.87]大道便会暗\n[02:45.52]你说的珍重\n[02:48.27]语气太窝心\n[02:50.07]承诺过终生的约却没下文\n[02:53.92]明明不应该牵挂你神情\n[02:59.32]明明不应该将细节辨认\n[03:04.62]明明双方都打破约定\n[03:07.97]彼此都需要冷静\n[03:10.32]怎么始终我挥之不去窝心笑声\n[03:15.22]明明不应该一再说明明\n[03:20.72]明明好应该相信这是命\n[03:25.92]明明烛光都烧化散剩\n[03:29.22]怎分开都已决定\n[03:31.87]怎么一想你始终都会浸湿眼睛\n[03:36.56]人宁愿金鱼般记性\n', '1369722854', '0')
